pragma solidity ^0.6.6;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Strings.sol"; 

interface Token20 {
    //This will set the birth time of NFT in ICT contract
    function setBirthOfNFT(uint256 _tokenId, uint256 _time) external;

    /**
     * @dev Returns the amount of tokens in existence.
     */
    function totalSupply() external view returns (uint256);

    /**
     * @dev Returns the amount of tokens owned by `account`.
     */
    function balanceOf(address account) external view returns (uint256);

    /**
     * @dev Moves `amount` tokens from the caller's account to `recipient`.
     *
     * Returns a boolean value indicating whether the operation succeeded.
     *
     * Emits a {Transfer} event.
     */
    function transfer(address recipient, uint256 amount)
        external
        returns (bool);

    /**
     * @dev Returns the remaining number of tokens that `spender` will be
     * allowed to spend on behalf of `owner` through {transferFrom}. This is
     * zero by default.
     *
     * This value changes when {approve} or {transferFrom} are called.
     */
    function allowance(address owner, address spender)
        external
        view
        returns (uint256);

    /**
     * @dev Sets `amount` as the allowance of `spender` over the caller's tokens.
     *
     * Returns a boolean value indicating whether the operation succeeded.
     *
     * IMPORTANT: Beware that changing an allowance with this method brings the risk
     * that someone may use both the old and the new allowance by unfortunate
     * transaction ordering. One possible solution to mitigate this race
     * condition is to first reduce the spender's allowance to 0 and set the
     * desired value afterwards:
     * https://github.com/ethereum/EIPs/issues/20#issuecomment-263524729
     *
     * Emits an {Approval} event.
     */
    function approve(
        address owner,
        address spender,
        uint256 amount
    ) external returns (bool);

    /**
     * @dev Moves `amount` tokens from `sender` to `recipient` using the
     * allowance mechanism. `amount` is then deducted from the caller's
     * allowance.
     *
     * Returns a boolean value indicating whether the operation succeeded.
     *
     * Emits a {Transfer} event.
     */
    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external returns (bool);

    /**
     * TODO: Add comment
     */
    function burn(uint256 burnQuantity) external returns (bool);

    /**
     * @dev Emitted when `value` tokens are moved from one account (`from`) to
     * another (`to`).
     *
     * Note that `value` may be zero.
     */
    event Transfer(address indexed from, address indexed to, uint256 value);

    /**
     * @dev Emitted when the allowance of a `spender` for an `owner` is set by
     * a call to {approve}. `value` is the new allowance.
     */
    event Approval(
        address indexed owner,
        address indexed spender,
        uint256 value
    );
}

contract LedNFT is ERC721 {
    using SafeMath for uint256;
    mapping(uint256 => bool) public numNotAllowed;
    mapping(uint256 => address payable) public initialOwner;

    // string public baseURi;

    // tokens minted by an address
    mapping(address => uint256) public mintCount;
    uint256[] mintedIds;

    struct tokenSaleStat {
        bool forSale;
        uint256 price;
    }
    mapping(uint256 => tokenSaleStat) public tokenSaleData;

    uint256 nonce = 0;

    event MintedNFT(address indexed _owner, uint256 indexed _tokenId);

    // owners and their pulse and seed
    struct pulseData {
        uint256[] pulse;
        uint256 seed;
    }

    // owner of skin
    mapping(bytes32 => address) public skinOwner;

    // skin to pulseData
    mapping(bytes32 => pulseData) public skinToPulse;

    // token to skins
    mapping(uint256 => bytes32[]) public tokenSkin;

    // token to tokenhash
    mapping(uint256 => bytes32) public tokenHash;

    //mapping for NFT tokendID to blinking pattern
    mapping(uint256 => uint256[]) public ledNFTBlinkPattern;

    //Store the ICT token contract address
    address public ICTContractAddress;

    //owner of the contract
    address public owner;

    //mapping of address to their minted token count
    mapping(address => uint256) public ownerTotalTokensMintCount;

    //end time for minting NFT once the timer is started
    uint256 public endTime;

    //It stores the pause/unpause status of minting (owner can pause/unpause the minting)
    bool public isMintingActive;

    //Maximum NFT supply
    uint256 public constant MAX_NFT_SUPPLY = 2048;

    //1 ICT token is required to change the LED NFT blink pattern
    uint256 public constant BLINK_PATTERN_CHANGE_PRICE = 1 * 10**18;

    modifier onlyOwner() {
        require(
            owner == msg.sender,
            "Only owner is authorized for this transaction"
        );
        _;
    }

    // mapping(uint256 => string) private _tokenURIs;

    constructor(address _ictAddress, string memory _initBaseURI) public ERC721("LedNFT", "LED") {
        ICTContractAddress = _ictAddress;
        owner = msg.sender;
        isMintingActive = false;
        endTime = 0;
        _setBaseURI(_initBaseURI);
    }

    // function setBaseURI(string memory _newBaseURI) internal virtual override onlyOwner {
    //     baseURi = _newBaseURI;
    // }

    //  function _exists(uint256 tokenId) internal view virtual override returns (bool) {
    //     return ownerOf(tokenId) != address(0);
    // }

     // internal
//   function _baseURI() internal view virtual returns (string memory) {
//     return baseURI;
//   }

//      function tokenURI(uint256 tokenId)
//     public
//     view
//     virtual
//     override
//     returns (string memory)
//   {
//     require(
//       _exists(tokenId),
//       "ERC721Metadata: URI query for nonexistent token"
//     );
    
//     string memory currentBaseURI = baseURI();
//     return bytes(currentBaseURI).length > 0
//         ? string(abi.encodePacked(currentBaseURI, Strings.toString(tokenId)))
//         : "";
//   }

    //Function accepts epoch time as parameter which will be added to the current epoch time and timer will be started
    function startTimerForNFTMinting(uint256 _endTimeLimit) public onlyOwner {
        endTime = block.timestamp + _endTimeLimit;
    }

    //Function to pause and unpause minting process
    function pauseUnpauseMinting(bool _status) public onlyOwner {
        isMintingActive = _status;
    }

    //function to get the NFT price based on the supplied NFT's
    function getNFTPrice(uint256 _nos) public view returns (uint256) {
        require(endTime >= block.timestamp, "Sale is over!");
        require(totalSupply() <= MAX_NFT_SUPPLY, "All NFT's are minted");

        uint256 priceOfOneToken = 0.8 * 10**18;

        return _nos * priceOfOneToken;
    }

    //Get contract balance
    function getContractBalance() public view onlyOwner returns (uint256) {
        return address(this).balance;
    }

    //Get the blinking pattern for any LED NFT
    function getBlinkPatternOfTokenID(uint256 _tokenId)
        public
        view
        returns (uint256[] memory)
    {
        require(
            _tokenId <= MAX_NFT_SUPPLY,
            "Token Id should be less than maximum supply"
        );
        require(
            ledNFTBlinkPattern[_tokenId].length == 30,
            "NFT for the supplied tokenId is not minted yet"
        );
        return ledNFTBlinkPattern[_tokenId];
    }

    //method to mint LED NFT tokens for msg.sender
    function mintToken(uint256 _nos) public payable {
        require(
            _nos >= 1 && _nos <= 3,
            "You can mint only 1 or 2 or 3 tokens in one operation."
        );
        for (uint8 j = 0; j < _nos; j++) {
            require(isMintingActive == true, "Minting is Paused!");

            require(endTime >= block.timestamp, "Sale is over!");

            require(
                ownerTotalTokensMintCount[msg.sender] < 3,
                "Max 3 tokens can be minted per user"
            );

            require(
                totalSupply() < MAX_NFT_SUPPLY,
                "Cannot mint more NFT, 2048 is the max NFT supply limit"
            );

            require(
                getNFTPrice(_nos) == msg.value,
                "Ether value is incorrect, please send correct amount"
            );

            // uint256 tokenId = totalSupply() + 1;
            uint256 tokenId = 0;
            uint256 randomNumber = uint256(
                keccak256(abi.encodePacked(now, msg.sender, nonce))
            ) % 2048;
            randomNumber = randomNumber + 1;
            nonce++;

            do {
                if (numNotAllowed[randomNumber] == true) {
                    randomNumber = (randomNumber + 1) % 2049;
                    if (randomNumber == 0) {
                        randomNumber = randomNumber + 1;
                    }
                } else {
                    numNotAllowed[randomNumber] = true;
                    tokenId = randomNumber;
                    break;
                }
            } while (tokenId == 0);

            // forSale[_tokenId] = false;
            mintCount[msg.sender] += 1;
            initialOwner[tokenId] = msg.sender;
            ++ownerTotalTokensMintCount[msg.sender];
            mintedIds.push(tokenId);

            //Generating random LED blink pattern array
            for (uint256 i = 0; i < 30; i++) {
                ledNFTBlinkPattern[tokenId].push(
                    uint256(
                        keccak256(
                            abi.encodePacked(
                                msg.sender,
                                block.timestamp,
                                block.difficulty,
                                i
                            )
                        )
                    ) % 101
                );
            }

            // pulseOwner[msg.sender].pulse = getBlinkPatternOfTokenID(tokenId);
            // pulseOwner[msg.sender].seed = nseed;

            // generating a unique seed
            uint256 nseed = uint256(
                keccak256(abi.encodePacked(tokenId, block.timestamp))
            );

            // pulse
            uint256[] memory npulse = getBlinkPatternOfTokenID(tokenId);
            // use built array

            // calculate skin
            bytes32 skin = keccak256(abi.encodePacked(npulse, nseed));

            // record history of skin - token to string
            tokenSkin[tokenId].push(skin);

            skinOwner[skin] = msg.sender;

            // skin to its data
            skinToPulse[skin].pulse = npulse;
            skinToPulse[skin].seed = nseed;

            //set birth time of NFT in ICT contract, this will be used in calculation of claim ICT amount
            Token20(ICTContractAddress).setBirthOfNFT(tokenId, block.timestamp);
            tokenHash[tokenId] = keccak256(abi.encodePacked(tokenId));

            //Mint ERC721
            _safeMint(msg.sender, tokenId);
            // _setTokenURI(
            //     tokenId,
            //     "https://gateway.pinata.cloud/ipfs/QmW6vbWAruEUAaQYjHBZB1xgcutAewVhRhCFW3PUTR5pTj/1.json"
            // );
            emit MintedNFT(msg.sender, tokenId);
        }
    }

    function changeLEDBlinkPattern(
        uint256 _tokenId,
        uint256[30] memory _newPattern
    ) public {
        address ownerOfToken = ownerOf(_tokenId);
        require(ownerOfToken == msg.sender, "Not authorised");
        require(
            Token20(ICTContractAddress).balanceOf(msg.sender) >=
                BLINK_PATTERN_CHANGE_PRICE,
            "Not enough balance"
        );
        require(
            keccak256(abi.encodePacked(_newPattern)) !=
                keccak256(abi.encodePacked(getBlinkPatternOfTokenID(_tokenId))),
            "New pattern is same as the current one"
        );

        //validate blink pattern
        for (uint256 i = 0; i < 30; i++) {
            if (!(_newPattern[i] >= 0 && _newPattern[i] <= 100)) {
                revert("Invalid blink pattern");
            }
        }

        ledNFTBlinkPattern[_tokenId] = _newPattern;

        // new seed
        uint256 nseed = uint256(
            keccak256(abi.encodePacked(_tokenId, block.timestamp))
        );

        // calculate skin
        bytes32 skin = keccak256(abi.encodePacked(_newPattern, nseed));

        // record history of skin - token to string
        tokenSkin[_tokenId].push(skin);

        skinOwner[skin] = msg.sender;

        // skin to its data
        skinToPulse[skin].pulse = _newPattern;
        skinToPulse[skin].seed = nseed;

        Token20(ICTContractAddress).approve(
            msg.sender,
            address(this),
            BLINK_PATTERN_CHANGE_PRICE
        );
        bool res1 = Token20(ICTContractAddress).transferFrom(
            msg.sender,
            address(this),
            BLINK_PATTERN_CHANGE_PRICE
        );

        require(res1, "Failed to transfer ICT");
    }

    //Owner can withdraw the Ethers collected via NFT minting
    function withdrawCollectedEther() public onlyOwner {
        address payable addr = payable(msg.sender);
        uint256 amount = getContractBalance();
        addr.transfer(amount);
    }

    // ////////////////
    function mintedTokens(address _address) public view returns (uint256) {
        return mintCount[_address];
    }

    //

    function markForSale(uint256 _tokenId, uint256 _price) public {
        require(
            tokenSaleData[_tokenId].forSale != true,
            "Token already avaiable for sale."
        );
        require(
            msg.sender == ownerOf(_tokenId),
            "Only the owner can mark items for sale."
        );
        tokenSaleData[_tokenId].forSale = true;
        tokenSaleData[_tokenId].price = _price;
    }

    function getPriceOfToken(uint256 _tokenId) public view returns (uint256) {
        return tokenSaleData[_tokenId].price;
    }

    function isAvailableForSale(uint256 _tokenId) public view returns (bool) {
        return tokenSaleData[_tokenId].forSale;
    }

    // buyer side
    function sendMoney(address payable _to, uint256 _value) private {
        require(_value <= address(this).balance, "msg");
        _to.transfer(_value);
    }

    function transferPurchasedToken(
        address from,
        address to,
        uint256 tokenId
    ) private {
        _transfer(from, to, tokenId);
    }

    // buy function
    function purchaseToken(uint256 _tokenId) public payable {
        require(
            isAvailableForSale(_tokenId) == true,
            "Token not availale for sale"
        );
        require(
            getPriceOfToken(_tokenId) == msg.value,
            "value sent is not equal to the price"
        );
        require(
            ownerOf(_tokenId) != msg.sender,
            "You cannot sell tokens to yourself."
        );

        uint256 value = msg.value;

        // transfer 10% of msg.value to owner
        uint256 _10value = value.div(10);
        sendMoney(initialOwner[_tokenId], _10value);

        // transfer 90% to new owner
        uint256 _90value = (value.mul(9)) / 10;
        sendMoney(payable(ownerOf(_tokenId)), _90value);

        // unmark from sale
        tokenSaleData[_tokenId].price = 0;
        tokenSaleData[_tokenId].forSale = false;

        // transfer token ot buyer
        transferPurchasedToken(ownerOf(_tokenId), msg.sender, _tokenId);
    }

    // list of all ids in circulation
    function allMintedId() public view returns (uint256[] memory) {
        return mintedIds;
    }

    // get all skins of a token
    function getSkinsOfToken(uint256 _tokenId)
        public
        view
        returns (bytes32[] memory)
    {
        require(
            msg.sender == ownerOf(_tokenId),
            "You can only view your own skins"
        );
        return tokenSkin[_tokenId];
    }

    function getpulseNSeed(bytes32 _skin)
        public
        view
        returns (uint256[] memory, uint256)
    {
        require(
            msg.sender == skinOwner[_skin],
            "Only skin owner can view their skins."
        );

        return (skinToPulse[_skin].pulse, skinToPulse[_skin].seed);
    }

    // opensea methods
    // function _setBaseURI() internal override {
    //     _baseURI = "ipfs://QmW6vbWAruEUAaQYjHBZB1xgcutAewVhRhCFW3PUTR5pTj";
    // }

    // function _setTokenURI(uint256 tokenId, string memory _tokenURI) internal override {
    //     require(
    //         _exists(tokenId),
    //         "ERC721Metadata: URI set of nonexistent token"
    //     );
    //     _tokenURIs[
    //         tokenId
    //     ] = "https://gateway.pinata.cloud/ipfs/QmW6vbWAruEUAaQYjHBZB1xgcutAewVhRhCFW3PUTR5pTj/1.json";
    // }

    // opensea method
    // function tokenURI(uint256 _tokenId) public view override returns (string memory) {
    //     return "https://gateway.pinata.cloud/ipfs/QmdBRTXNt5vWpMxun8CpM9bDmxFdzro3oq7n3KPFfNriyk/1.jpg";
    // }
}

